import './styles.css';
import React, { Component } from "react";
import { motion } from "motion/react"
// import { delay } from "motion"

function Body() {
  return (
    <body>
      <Sidebar/>
      {/* <Title/>      
      <EditTracker/>
      <Canvas/>
      <VDivider/>
      <Footer/> */}
    </body>
  )
}

function AnimatedSidebar() {
  return (
    <motion.div initial={{ x: -0 }} animate={{ x: 100 }}>
      <Sidebar/>
    </motion.div>
  )
}

const sideBarBtnsConfig = [
  {title: 'Bio', className: 'side-bar-btn'},
  {title: 'Thoughts', className: 'side-bar-btn'},
  {title: 'Poker', className: 'side-bar-btn'},
]

const sideBarBtns = sideBarBtnsConfig.map(btn => <button 
  style={{
    color: 'lightgray',
    width: '80px',
    height: '50px',
    backgroundColor: 'blue',
    border: 'none'
  }}>
  {btn.title}
</button>)

const containerStyle = {
  display: 'flex',
  flexDirection: 'column', // Align buttons vertically
  justifyContent: 'center', // Center buttons vertically within the container
  alignItems: 'center', // Optionally center buttons horizontally
  // height: '100vh', // Full viewport height to enable vertical centering
}

const sidebarStyle = {
  zIndex: '1'
}

/* .sidebar {
  z-index: 1;
  position: absolute;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  width: 150px;
} */

function Sidebar() {
  return (
    <div className='sidebar' >
      <div style={containerStyle}>{sideBarBtns}</div>
      <HDivider/>
    </div>
  )
}

// favorite function: compactMap
// favorite language: Swift

function Title() { return <h1 className='title'>Braeden Meikle</h1> }

const lastEditDate = 'Tuesday, November 26'
const holeInOneCounter = '1'
const royalFlushCounter = '0'

function EditTracker() {
  return (
    <div className='edit-tracker'>
      <p className='last-seen'>Last seen:</p>
      <p className='date'>{lastEditDate}</p>
    </div>
  )
}

function Canvas() { return <div className='canvas'></div> }
function HDivider() { return <div className='side-bar-hdiv'></div> }
function VDivider() { return <div className='footer-vdiv'></div> }

function Footer() {
  return (
    <div className='footer'>
      <p className='footer-txt'>Created November 26, 2024</p>
      <p className='footer-hdiv'>|</p>
      <span className='footer-txt' id='phone'></span>
      <p className='footer-hdiv'>|</p>
      <span className='footer-txt' id='email'></span>
      <p className='footer-hdiv'>|</p>
      <span className='footer-txt' id='linkedin'></span>
      <p className='footer-hdiv'>|</p>
      <span className='footer-txt' id='github'></span>
    </div>
  )
}

function App() {
  return <Body/>
}

